description:
SG-1 vindt in de Tok'ra, een vriendelijke afsplitsing van de goa'uld, en de Asgard, een technologisch zeer geavanceerd ras, bondgenoten voor hun strijd tegen de Goa'uld

21.1969 - 5 maart 1999 - Door een zonnevlam is SG-1 in 1969 terechtgekomen, en wordt geholpen door generaal Hammond.

22.Out of Mind - deel 1 - 12 maart 1999 - O'Neill wordt wakker in het jaar 2077. De aarde heeft de Goa'uld verslagen en SG-1 is omgekomen.

